import React from 'react'
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Box,
    Typography
}
from '@material-ui/core';

import {
    ArrowBack,
    Home,
    Apps,
    ContactMail,
    AssignmentInd

} from '@material-ui/icons';

export default function Navbar() {
    return (
        <Box component='nav'>
                 <AppBar>
                       <Toolbar>
                               <ArrowBack>
                                        
                               </ArrowBack>
                       </Toolbar>
                 </AppBar>
        </Box>
    )
}
